private DocIdSetIterator getDISI(Filter filter, AtomicReaderContext context)
throws IOException {
    DocIdSet docIdSet = filter.getDocIdSet(context);
    if (docIdSet == null) {
      return DocIdSet.EMPTY_DOCIDSET.iterator();
    } else {
      DocIdSetIterator iter = docIdSet.iterator();
      if (iter == null) {
        return DocIdSet.EMPTY_DOCIDSET.iterator();
      } else {
        return iter;
      }
    }
}

